script: |
  super -f tsv -I q8611.sql | sort > q8611.out

vector: true

inputs:
  - name: q8611.sql
    data: |
      SELECT ALL - COALESCE ( + 73, COUNT ( * ) * + 29 ) AS col0, - COALESCE ( - + 70, 90 + ( NULLIF ( - - 33, COUNT ( ALL + 42 ) ) ) ) / - 31 col2;

outputs:
  - name: q8611.out
    data: |
      -73	-2
